import { BsPlusCircleFill } from "react-icons/bs";

const Ideas = () => {
  return (
    <div className="w-full md:w-4/5 flex justify-between">
      <div className="w-full p-8 flex justify-between">
        <h5>My Ideas</h5>
        <BsPlusCircleFill size={32} color="green" />
      </div>
    </div>
  );
};

export default Ideas;
